def distance_squared(first_point, second_point):
    #print(first_point, second_point)
    return ((first_point.x - second_point.x) ** 2 + (first_point.y - second_point.y) ** 2)**0.5
    #return ((first_point[] - second_point[0]) ** 2 + (first_point[1] - second_point[1]) ** 2)**0.5

def minimum_distance_squared_naive(points):
    min_distance_squared = float("inf")

    for p, q in combinations(points, 2):
        min_distance_squared = min(min_distance_squared,
                                   distance_squared(p, q))

    return "{0:.9f}".format(min_distance_squared)


def minimum_distance(points):
  points.sort()
  #mdsRecur(points, 0, len(points)-1)
  #'{:0<10}'.format(mdsRecur(points, 0, len(points)-1))
  return "{0:.9f}".format(mdsRecur(points, 0, len(points)-1))
  

def mdsRecur(points, start, end):
  if end-start==1:
    return distance_squared(points[start], points[end])
  midIdx = (end+start)//2
  minD = min(mdsRecur(points, start, midIdx), mdsRecur(points, midIdx, end))
  return min(minD, closePoints(points, midIdx, minD, start, end))

